import React, { Component } from 'react'

export default class Ccomponent extends Component {
constructor(props) {
  super(props)

  this.state = {
     input: ''
  }
this.Change = this.Change.bind(this)
}


Change(event){
this.getState({
    input: event.target.value
})
}


  render() {
    return (
      <div>
          <h1>{this.state.input}</h1>
          <input onChange={this.Change}></input>
      </div>
    )
  }
}
